import React from "react";
import Heading from "./Header.jsx";
import Footer from "./Footer.jsx";
import Note from "./Note.jsx";
import notes from "../notes.js";

function createNote(props)
{
  return (
    <Note
     key={props.key}
     title={props.title}
     content={props.content}
     />
  );
}

function App()
{
   return <div>
     <Heading />
     //hello
     {notes.map(createNote)}
     <Footer />
   </div>
}

export default App;
